import React from 'react'

export default class FileForm extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <input
                    onBlur={(event) => this.props.handleValueChange(event)}
                    className="form-control"
                    type="text"
                    name="fileName"
                    placeholder="Enter fileName" />
                <button type="submit" className="btn btn-info custom-button" onClick="">Load text</button>
            </div>
        )
    }

}
